import React from 'react'

function Navbar() {
    return (
        <div className="navbar">
            <h1>Sagar Blogs</h1>
            <div className="links">
                <a href="/">Home</a>
                <a href="/create" style={{
                    color: "white",
                    backgroundColor: "#f1356d",
                    borderRadius: "8px"
                }}>New Blogs</a>

            </div>
        </div>
    )
}

export default Navbar;
